import React from 'react';

export default function IletisimAyarlari() {
  return (
    <iframe
      title="İletişim Ayarları"
      src="/pages/isletme_panel/ayarlar/iletisim_ayarlari/index.html"
      width="100%"
      height="1000px"
      style={{ border: 'none' }}
    ></iframe>
  );
}
